    <div className="appWrapper">
      <Header />
      <Navbar />
      <div className="content">
        <div>
          <img src="https://i.ytimg.com/vi/qexSc8CnQd4/maxresdefault_live.jpg"></img>
        </div>
        <div>ava+des</div>
        <div>
          my posts
